public void readFields(DataInput in) throws IOException {
  int sz = in.readInt();
  if (sz < 0) throw new IOException("Invalid size: " + sz + " for file metadata object");
  this.theMetadata = new TreeMap<Text, Text>();
  for (int i = 0; i < sz; i++) {
    Text key = new Text();
    Text val = new Text();
    key.readFields(in);
    val.readFields(in);
    this.theMetadata.put(key, val);
  }    
}

